import {BrowserRouter, Switch, Route} from "react-router-dom"





import Banner from "./Banner"



export default class HomeTest extends Component
{

    constructor(props)
    {
        super(props)

        this.state = {
            banner:true
        }
    }

    

    render()
    {

    const bannerHandler = bannerHandler()
    {
        this.setState({banner:false})
    }


        return (
            <div>

            {this.state.banner ? <Banner bannerHandler={bannerHandler}>yeboiiiii</Banner> : null}
            
            </div>
        )
    }
}
